import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Automation Logic ---

    // 1. Open the mobile menu which acts as a modal overlay
    const menuButton = page.locator('div.nav-menu:has-text("All")');
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // 2. Wait for the modal overlay to be visible and take a screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract class attribute to verify it's open
    const overlayClassBefore = await page.locator('#mobileMenuOverlay').getAttribute('class');

    // 3. Press the "Escape" key to close the modal
    await page.keyboard.press('Escape');

    // 4. Wait for the modal overlay to be hidden and take a screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract class attribute to verify it's closed
    const overlayClassAfter = await page.locator('#mobileMenuOverlay').getAttribute('class');

    return {
      success: true,
      action: "Successfully closed the mobile menu modal using the Escape key.",
      extractedData: {
        overlayClassBefore: overlayClassBefore,
        overlayClassAfter: overlayClassAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
